import React from 'react';
import Layout from './Layout';

const News = (props) => {
    return (
        <Layout>
            <h1>News daily.</h1>
            <hr></hr>
        </Layout>
    )
}


News.getInitialProps = async () => {
    const res = await fetch(`https://newsapi.org/v2/top-headlines?sources=google-news&apiKey=21105020649e498283c05f6fa7ab0cb4`);
    const data = await res.json();
    
    console.log(data);

    return {
        News: data
    }
    
}

export default News;
